Build a Rust program that calculates the sum of all even integers between two given numbers. The program should take two integers as input and print the sum of all even integers between them.

Example:
```
Input: 2 6
Output: 12
Explanation: The sum of all even integers between 2 and 6 is 12.
```
Solution:
```
fn main() {
    let mut a = 2;
    let mut b = 6;

    let mut sum = 0;

    while a <= b {
        if a % 2 == 0 {
            sum += a;
        }
        a += 1;
    }

    println!("{}", sum);
}
```


